import { AuthLogin } from "../Auth/AuthLogin";
import { AuthSignUp } from "../Auth/AuthSignUp";



export const AuthModal =  () =>{
    return(
        <div className="auth-modal-container fixed">
            <div className="auth-modal">
                <div className="d-flex align-center shadwo" >
                    <button   className="button btn-auth grow-shrink-basis cursor-pointer">Login</button>
                    <button className="button btn-auth grow-shrink-basis cursor-pointer">Singup</button>
                    <button className="button btn-auth d-flex align-center justify-center cursor-pointer">
                    <span className="material-icons-outlined">close</span>
                    </button>
                    
                </div>
            </div>
        </div>
    )
}
